import React from 'react';
import Toolbar from './Toolbar'
import Log from './Log'
import './App.css';

const ActiveCategories = React.createContext('activeCategories');

class App extends React.Component {
  constructor() {
    super(props);
    this.state = 
    {
      categories: {
          'assert': true,        
          'error': true,
          'exception': true,
          'warning': true,
          'system': true,        
          'performance': true,
          'log': true, 
          'graphics': true, 
          'ai': true,
          'audio': true, 
          'content': true, 
          'logic': true, 
          'gui': true, 
          'input': true,  
          'network': true, 
          'animation': true, 
          'physics': true, 
          'event': true
      }
    }
  }

  render() {
    return (
      <ActiveCategories.Provider value={['assert', 'error', 'exception', 'warning', 'system', 'performance', 'log', 'graphics', 'ai', 'audio', 'content', 'logic', 'gui', 'input', 'network', 'animation', 'physics', 'event']}>
        <div className="App">
          <Toolbar/>
          <div>
            <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
            <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
            <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
            <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
            <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
          </div>
        </div>
      </ActiveCategories.Provider>

    );
  }
}

export default App;
